import Aboutus from "./About/Aboutus";
import Vision from "./About/Vision";

export default function About() {
  return (
    <div>
      <Vision />
      <Aboutus />
      <button id="scroll-top" title="Back to Top">
        <i class="icon-arrow-up"></i>
      </button>
    </div>
  );
}
